import React from "react";
import LayoutMovies from '../../components/layout/index';
import {Row, Col, Input} from 'antd';
const {Search} = Input;
const SearchMovies = () => {
    return (
        <LayoutMovies>
            <Row>
                <Col span={24}>
                    <h1>This is search movies page!</h1>
                </Col>
            </Row>
        </LayoutMovies>
    )
}
export default React.memo(SearchMovies);
